// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

// import "@openzeppelin/contracts/governance/TimelockController.sol";
import "@openzeppelin/contracts/utils/Create2.sol";
import "./PoolGovernor.sol";
// import "./Pool.sol";

contract PoolGovernorFactory {
    // events
    event ProxyCreated(address poolGov);

    function computeAddress(uint256 salt, address _pool, address payable _timelock) public view returns (address) {
        bytes32 _bytecodeHash = keccak256(getCreationCode(_pool, _timelock));
        return Create2.computeAddress(
                keccak256(abi.encodePacked(salt)),
                _bytecodeHash,
                address(this)
            );}

    function deploy(bytes32 salt, address _pool, address payable _timelock) public{
        bytes memory _bytecode = getCreationCode(_pool, _timelock); //abi.encodePacked(_bytecodeHash);

        address proxy = Create2.deploy(
            0,
            salt,
            _bytecode
        );
        emit ProxyCreated(proxy);}

    function getCreationCode(address _pool, address payable _timelock) public pure returns(bytes memory){
        bytes memory _bytecode = type(PoolGovernor).creationCode;
        _bytecode = abi.encodePacked(_bytecode, abi.encode(_pool, _timelock));
        return _bytecode;}

    // function createPoolGovernor(Pool _pool, TimelockController _timelock, bytes32 _salt) external {
